import React from "react";
import { connect } from "react-redux";

import { showAll, showPending, showCompleted } from "../store/filter";

const Tabs = ({ showAll, showPending, showCompleted }) => {
  return (
    <div className="tab-section">
      <ul>
        <li onClick={showAll}>All</li>
        <li onClick={showPending}>Pending</li>
        <li onClick={showCompleted}>Completed</li>
      </ul>
    </div>
  );
};

const mapDispatchToProps = dispatch => {
  return {
    showAll: dispatch(showAll()),
    showPending: dispatch(showPending()),
    showCompleted: dispatch(showCompleted())
  };
};
export default connect(null, mapDispatchToProps)(Tabs);
